// App.js
import React from 'react';

function App() {
  const handleClick = async () => {
    try {
      const response = await fetch('/print-message');
      const data = await response.text();
      console.log(data); // Log the response from the backend
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="App">
      <h1>Click the button to print a message from the backend</h1>
      <button onClick={handleClick}>Print Message</button>
    </div>
  );
}

export default App;
